export default function AddNotice() {
    function MyForm() {
        const [name, setName] = useState("");
      
        return (
          <form>
            <label>Enter your name:
              <input
                type="text" 
                value={name}
                onChange={(e) => setName(e.target.value)}
              />
            </label>
          </form>
        )
      }
}
